	public void render(Entity entity, float f, float f1, float f2, float f3,
			float f4, float f5) {
		super.render(entity, f, f1, f2, f3, f4, f5);
		setRotationAngles(f, f1, f2, f3, f4, f5, entity);
		Neck.render(f5);
		NeckBase.render(f5);
		CollarBone.render(f5);
		UpperBody.render(f5);
		Body.render(f5);
		Gut.render(f5);
		Bottom.render(f5);
		LEFTWING.render(f5);
		RIGHTWING.render(f5);
		TAIL.render(f5);
		LEFTLEG.render(f5);
		RIGHTLEG.render(f5);
		LEFTARM.render(f5);
		HEADBASE.render(f5);
		RIGHTARM.render(f5);
	}

	private void setRotation(ModelRenderer model, float x, float y, float z) {
		model.rotateAngleX = x;
		model.rotateAngleY = y;
		model.rotateAngleZ = z;
	}

	public void setRotationAngles(float f, float f1, float f2, float f3,
			float f4, float f5, Entity entity) {
		super.setRotationAngles(f, f1, f2, f3, f4, f5, entity);
		HEADBASE.rotateAngleY = f3 / (180F / (float) Math.PI);
		HEADBASE.rotateAngleX = f4 / (180F / (float) Math.PI);
		RIGHTLEG.rotateAngleX = MathHelper.cos(f * 0.75F) * 0.7F * f1;
		LEFTLEG.rotateAngleX = MathHelper.cos(f * 0.75F + (float) Math.PI)
				* 0.5F * f1;
		LEFTARM.rotateAngleX = MathHelper.cos(f * 0.75F) * 0.7F * f1;
		RIGHTARM.rotateAngleX = MathHelper.cos(f * 0.75F + (float) Math.PI)
				* 0.5F * f1;
		TAIL.rotateAngleY = MathHelper.cos(f * 0.75F) * 0.65F * f1;
		LEFTWING.rotateAngleY = MathHelper.cos(f * 0.75F) * 0.4F * f1;
		RIGHTWING.rotateAngleY = MathHelper.cos(f * 0.75F + (float) Math.PI)
				* 0.4F * f1;

	}

